import React from 'react'

import ProjectContainer from '../Project/ProjectContainer'
import { Element } from 'react-scroll'
const Project = () => {
  const projectData=[
    {
        id:1,
        img:"./all assets/Zomato.png",
        title:"Zomato",
        desc:"Zomato "
    },
    {
        id:2,
        img:"./all assets/youtube.png",
        title:"Youtube",
    },
    {
        id:3,
        img:"./all assets/oneplus.png",
        title:"OnePlus",
    },
    {
        id:4,
        img:"./all assets/netflix.png",
        title:"Netflix",
    },
    {
        id:5,
        img:"./all assets/cake website.png",
        title:"Cake & Pasteries",
    },
    {
        id:6,
        img:"./all assets/matrimoney.png",
        title:"Matrimony",
    },



]

    
  return (
   <>
   
   <Element className="projectcontainer" id="projects">
    <h1>Projects</h1>
    <p>Here some projects which i have done using Front end Tools</p>
    <div className="projectcontainer__projects">
      {
        projectData.map((project,index)=>{
         return(
          <>
          
          <ProjectContainer key={index} img={project.img} title={project.title} />
          
          </>
         )


        })
      }

    </div>




   </Element>
   
   
   </>
  )
}

export default Project
